    "contracts/KaspaMiningStaking.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {Ownable2Step} from "@openzeppelin/contracts/access/Ownable2Step.sol";
import {IERC20Metadata} from "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import {HoldingsManager} from "./Libraries/HoldingsManager.sol";
// solhint-disable no-console
import {console} from "hardhat/console.sol";
// solhint-disable func-name-mixedcase

/**
 * @dev KaspasMining staking contract
 */
contract KaspaMiningStaking is Ownable2Step, HoldingsManager {
    IERC20Metadata public immutable rewardToken;
    uint8 public immutable rewardTokenDecs;

    event ClaimRewards(address indexed user, uint256 amountClaimed, uint256 userOffset);
    event DepositRewards(address indexed user, uint256 amountClaimed, uint256 totalScore, uint256 roundId);
    event CancelRewards(address indexed user, uint256 roundId);

    struct Round {
        bool canceled;
        uint16 id;
        uint32 timestamp;
        uint96 amount;
        uint96 totalScore;
    }

    struct UnpackedRound {
        bool canceled;
        uint256 id;
        uint256 timestamp;
        uint256 amount;
        uint256 totalScore;
    }

    uint16 public currentId;    
    mapping(address => uint16) public userRoundOffset;
    mapping(uint16 => Round) private _rounds;    

    constructor(address token, address _reward, address timerAddr) HoldingsManager(token, timerAddr) {
        rewardToken = IERC20Metadata(_reward);
        rewardTokenDecs = rewardToken.decimals();
    }

    //#region Helpers

    function rewardTokenPack(uint256 rewardTokenAmount) public view returns(uint96) {
        return uint96(rewardTokenAmount * (10**MAX_PRECISION_DIGITS) / (10**rewardTokenDecs));
    }

    function rewardTokenUnpack(uint96 rewardTokenAmount) public view returns(uint256) {
        return uint256(rewardTokenAmount) * (10**rewardTokenDecs) / (10**MAX_PRECISION_DIGITS);
    }

    //#endregion

    //#region ADMIN FUNCTIONS (HoldingsManager)

    /**
     * @notice Pause deposits (admin only)
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @notice Unpause deposits (admin only)
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    //#endregion

    //#region HoldingsManager

    /**
     * @notice Deposit the indicated amount of tokens
     */
    function deposit(uint256 _amount) external {
        uint16 _userRoundOffset = userRoundOffset[msg.sender];   

        if (_userRoundOffset == 0) {
            userRoundOffset[msg.sender] = currentId + 1;
        }
        else {
            //We claim existing rewards first
            if(_userRoundOffset <= currentId) {
                (uint256 amountClaim, uint16[] memory claimIds, uint16 lastId) = getUserPendingClaim(msg.sender, 0, 400);
                require(claimIds[claimIds.length - 1] == 0, "You have to claim rewards first");
                if (lastId > 0) {
                    claimRewardsInternal(amountClaim, lastId);
                }
            }
        }

        _deposit(msg.sender, _amount);
    }

    /**
     * @notice Withdraw the indicated amount of tokens
     */
    function withdraw(uint256 _amount) external {
        _withdraw(msg.sender, _amount);
        userRoundOffset[msg.sender] = currentId + 1; //offset update
    }

    //#endregion

    //#region RewardsManager

    /**
     * @notice Get round data
     */    
    function Rounds(uint16 index) public view returns(UnpackedRound memory) {
        Round memory _round = _rounds[index];
        return UnpackedRound(
            _round.canceled,
            uint256(_round.id),
            uint256(_round.timestamp),
            rewardTokenUnpack(_round.amount),
            stakeTokenUnpack(_round.totalScore)
        );
    }

    /**
     * @notice Get user pending claim amount and reward deposit ids, supports indexed searches
     */
    function getUserPendingClaim(
        address user,
        uint16 index,
        uint16 nTake
    ) public view returns (uint256, uint16[] memory, uint16) {
        uint16[] memory pendingClaimIds = new uint16[](nTake);
        uint256 amountClaim = 0;
        uint16 nTaken = 0;
        uint16 lastId = 0;        
        uint16 userOffset = userRoundOffset[user];
        uint16 _currentId = currentId;
        Round memory rd;

        for (uint16 _index = (index > userOffset ? index : userOffset); _index <= _currentId; _index++) {
            rd = _rounds[_index];
            if (rd.id == 0) break;
            if (!rd.canceled) {
                uint256 userScore = scoreOf(user, rd.timestamp);
                //CAREFUL!! totalScore is packaged, userScore is not and rd.amount is packaged 
                //both have also different decimals precision... could be unpacked later or not
                //amountClaim += rd.amount * userScore / uint256(rd.totalScore);
                amountClaim += rewardTokenUnpack(rd.amount) * userScore / stakeTokenUnpack(rd.totalScore);
                pendingClaimIds[nTaken] = rd.id;
                lastId = rd.id;
                nTaken++;
            }
            if (nTaken >= nTake) break;
        }

        if(amountClaim > 0) {
            amountClaim = amountClaim * 995 / 1000; //0.5%
            //amountClaim = rewardTokenUnpack(uint96(amountClaim)) / stakeTokenUnpack(1);
        }

        return (amountClaim, pendingClaimIds, lastId);
    }

    /**
     * @notice Claims user rewards, an amount of rounds has to be set for scalability
     */
    function claimRewards(uint16 nTake) public {
        (uint256 amountClaim, , uint16 lastId) = getUserPendingClaim(msg.sender, 0, nTake);
        require(lastId > 0, "There is nothing to claim");
        claimRewardsInternal(amountClaim, lastId);
    }

    function claimRewardsInternal(uint256 amountClaim, uint16 lastId) internal {
        require(lastId > 0, "There is nothing to claim");
        userRoundOffset[msg.sender] = lastId + 1; //offset update

        if (amountClaim > 0) {
            uint256 contractRewardBal = rewardToken.balanceOf(address(this));
            console.log("Token to claim %s, contract balance %s", amountClaim, contractRewardBal);
            require(contractRewardBal > amountClaim, "There is not enough tokens, wait for refill");
            bool result = rewardToken.transfer(msg.sender, amountClaim);
            require(result, "Error transferring tokens");
        }

        emit ClaimRewards(msg.sender, amountClaim, lastId + 1);
    }

    //#endregion

    //#region ADMIN FUNCTIONS (Rewards manager)

    /**
     * @notice Administrator can use this to inject rewards in the contract
     * @param totalScore is the sum of each holder score
     */
    function depositRewards(uint256 tokensAmount, uint256 totalScore) external onlyOwner {
        require(rewardToken.allowance(msg.sender, address(this)) >= tokensAmount, "Allowance not enough");

        currentId++;
        _rounds[currentId].id = uint16(currentId);
        _rounds[currentId].amount = rewardTokenPack(tokensAmount);
        _rounds[currentId].totalScore = stakeTokenPack(totalScore);
        _rounds[currentId].timestamp = uint32(getCurrentTime());

        bool result = rewardToken.transferFrom(msg.sender, address(this), tokensAmount);
        require(result, "Error transferring tokens");

        emit DepositRewards(msg.sender, tokensAmount, totalScore, currentId);
    }

    /**
     * @notice Administrator can use this to cancel a reward deposit round and get the money back
     */
    function cancelRound(uint16 RoundId) external onlyOwner { //CHECK THIS...TODO
        require(!_rounds[RoundId].canceled, "Reward deposit already canceled");
        _rounds[RoundId].canceled = true;
        uint256 contractBalance = rewardToken.balanceOf(address(this));

        bool result = rewardToken.transfer(msg.sender, min(rewardTokenUnpack(_rounds[currentId].amount), contractBalance));
        require(result, "Error transferring tokens");

        emit CancelRewards(msg.sender, RoundId);
    }

    //#endregion

    //#region ADMIN FUCNTIONS (Others)

    function withdrawRewards() external onlyOwner {
        uint256 contractBalance = rewardToken.balanceOf(address(this));
        bool result = rewardToken.transfer(msg.sender, contractBalance);
        require(result, "Error transferring tokens");
    }

    //#endregion
}
"
