    "contracts/Libraries/HoldingsManager.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import {Pausable} from "@openzeppelin/contracts/security/Pausable.sol";
import {IERC20Metadata} from "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import {Testable} from "./Testable.sol";
// solhint-disable no-console
//import {console} from "hardhat/console.sol";

// solhint-disable avoid-low-level-calls
// solhint-disable func-name-mixedcase
// solhint-disable-next-line max-states-count

/**
 * @notice Manage users holdings deposits and withdrawals
 * @dev Each hour user deposit is added to points, multiplied by 1 + multiplier bonus (0.5 per month, max 2)
 * each time one user withdraws any amount all points and multiplier bonus are lost
 */
contract HoldingsManager is Pausable, Testable { 

    struct UserData {
        uint32 lastUpdatedAt;
        uint32 multiplierStart;
        uint96 balance;
        uint96 points;
    }

    address[] internal _investors;
    mapping(address => UserData) internal userData;

    uint32 public constant HOLDING_END_TIME = type(uint32).max;

    IERC20Metadata public immutable TOKEN;
    uint8 public immutable stakeTokenDecs;
    uint8 public constant MAX_PRECISION_DIGITS = 9;

    uint256 private constant _HOUR = 1 hours; //3_600;
    uint256 private constant _DAY = 1 days; //_HOUR * 24;
    uint256 private constant _MONTH = 30 days; //_DAY * 30;

    uint256 private constant _BASIS_POINTS = 10_000;
    uint256 private constant _MULTIPLIER_PER_MONTH = 5_000; // bips
    uint256 private constant _EARLY_HOLDING_BONUS_PER_DAY = 5_000; // bips / hour
    uint256 private constant _BASE_MULTIPLIER = 10_000; // bips

    //bytes4 public decimalsCall = bytes4(keccak256(bytes("decimals()"))); //0xce974bc2

    event Deposit(address indexed user, uint256 amount);
    event Withdraw(address indexed user, uint256 amount);

    error InsufficientBalance();

    constructor(address token, address timerAddr) Testable(timerAddr) {
        TOKEN = IERC20Metadata(token);
        stakeTokenDecs = TOKEN.decimals();
        // (bool success, bytes memory _stakeTokenDecs) = token.call(abi.encode(decimalsCall));
        // stakeTokenDecs = abi.decode(_stakeTokenDecs, (uint8));
        // require(success, "Invalid tokens");
    }

    //#region Helpers

    function stakeTokenPack(uint256 stakeTokenAmount) public view returns(uint96) {
        return uint96(stakeTokenAmount * (10**MAX_PRECISION_DIGITS) / (10**stakeTokenDecs));
    }

    function stakeTokenUnpack(uint96 stakeTokenAmount) public view returns(uint256) {
        return uint256(stakeTokenAmount) * (10**stakeTokenDecs) / (10**MAX_PRECISION_DIGITS);
    }

    //#region VIEWS

    /**
     * @notice Gets the total number of investors
     */
    function nInvestors() public view returns (uint256) {
        return _investors.length;
    }

    /**
     * @notice Gets the balance of the user deposits
     * @param user User address
     * @return User deposit balance
     */
    function balanceOf(address user) external view returns (uint256) {
        return stakeTokenUnpack(userData[user].balance);
    }

    function lastUpdatedAt(address user) external view returns(uint256) {
        return userData[user].lastUpdatedAt;
    }

    function multiplierStart(address user) external view returns(uint256) {
        return userData[user].multiplierStart;
    }

    /**
     * @notice Gets the current amount of points earned by the user (including pending points)
     * @param user User address
     * @return User points
     */
    function pointsOf(address user, uint32 timestamp) public view returns (uint256) {
        return stakeTokenUnpack(userData[user].points + _computePendingPoints(user, timestamp));
    }

    /**
     * @notice Gets the current points multiplier of the user
     * @param user User address
     * @return User multiplier
     */
    function multiplierOf(address user, uint256 timestamp) public view returns (uint256) {
        UserData memory ud = userData[user];
        uint256 _multiplierStart = uint256(ud.multiplierStart);
        if (_multiplierStart == 0 || ud.balance == 0) {
            return _BASE_MULTIPLIER;
        }
        return
            _BASE_MULTIPLIER + (_MULTIPLIER_PER_MONTH * (min(timestamp, uint256(HOLDING_END_TIME)) - _multiplierStart)) / _MONTH;
    }

    /**
     * @notice Gets the current score of the user at a certain timestamp
     * @param user User address
     * @param timestamp time stamp you went to use to calculate points and multiplier
     * @return User score
     */
    function scoreOf(address user, uint32 timestamp) public view returns (uint256) {
        return (pointsOf(user, timestamp) * multiplierOf(user, timestamp)) / _BASIS_POINTS;
    }

    /**
     * @notice Checks acummulated scores using hot data
     * @return user acummulated scores
     */
    function getHotAcumScores(uint256 index, uint256 take) public view returns (uint256) {
        uint256 hotAcumScores = 0;
        uint32 blockTimestamp = uint32(getCurrentTime());
        for (uint256 _index = index; _index < _investors.length; _index++) {
            if (take != 0 && (_index - index) >= take) break;
            hotAcumScores += scoreOf(_investors[_index], blockTimestamp);
        }

        return hotAcumScores;
    }

    //#endregion

    //#region DEPOSITS AND WITHDRAWS

    /**
     * @notice Deposit TOKEN
     * @param amount Amount of TOKEN to deposit
     */
    function _deposit(address user, uint256 amount) internal {
        require(amount > 0, "You forgot to indicate the amount you want to deposit");
        __deposit(user, amount);

        bool result = TOKEN.transferFrom(user, address(this), amount);
        require(result, "Error transferring tokens");
    }

    /**
     * @notice Withdraw TOKEN and enforce multiplier penalty
     * @param amount Amount to withdraw
     */
    function _withdraw(address user, uint256 amount) internal {
        uint96 packedAmount = stakeTokenPack(amount);
        uint32 currentTime = uint32(getCurrentTime());

        _checkpoint(user, currentTime);

        UserData storage ud = userData[user];
        if (ud.balance < packedAmount) {
            revert InsufficientBalance();
        }

        //RESET        
        ud.multiplierStart = currentTime;
        //userData[user].lastUpdatedAt = currentTime; //already updated by checkpoint
        ud.points = 0;

        unchecked {
            ud.balance -= packedAmount;
        }

        TOKEN.transfer(user, amount);

        emit Withdraw(user, amount);
    }

    /**
     * @notice Deposit TOKEN from user
     * @param user User address
     * @param amount Amount of TOKEN to deposit
     */
    function __deposit(address user, uint256 amount) internal whenNotPaused {
        uint32 currentTime = uint32(getCurrentTime());
        UserData storage ud = userData[user];

        if (ud.multiplierStart == 0) {
            ud.multiplierStart = currentTime;
        }
        if (ud.lastUpdatedAt == 0) {
            //userData[user].lastUpdatedAt = uint32(getCurrentTime()); //already updated by checkpoint
            _investors.push(user);
        }
        _checkpoint(user, currentTime);

        ud.balance += stakeTokenPack(amount);

        emit Deposit(user, amount);
    }

    /**
     * @notice Record earned points and update the last checkpoint time; must be called on every deposit and withdrawal
     * @param user User address
     */
    function _checkpoint(address user, uint32 blockTimestamp) internal {
        UserData storage ud = userData[user];
        ud.points += _computePendingPoints(user, blockTimestamp);
        ud.lastUpdatedAt = blockTimestamp;
    }

    /**
     * @notice Compute the pending points that have been earned but not recorded since the last checkpoint
     * @param user User address
     * @return points Amount of earned unrecorded points
     */
    function _computePendingPoints(address user, uint32 timestamp) internal view returns (uint96) {
        UserData memory ud = userData[user];
        uint32 _HOLDING_END_TIME = HOLDING_END_TIME;
        uint256 start = min(ud.lastUpdatedAt, _HOLDING_END_TIME);
        uint256 end = min(timestamp, _HOLDING_END_TIME);
        return uint96((uint256(ud.balance) * (_BASIS_POINTS * (end - start))) / (_HOUR * _BASIS_POINTS));
    }

    //#endregion

    //#region HELPER FUNCTIONS

    function min(uint256 a, uint256 b) internal pure returns (uint256) {
        return a < b ? a : b;
    }

    //#endregion
}
"
    },
    "contracts/Libraries/Testable.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import {Timer} from "./../Timer.sol";

/**
 * @title Base class that provides time overrides, but only if being run in test mode.
 */
abstract contract Testable {
    // If the contract is being run on the test network, then `timerAddress` will be the 0x0 address.
    // Note: this variable should be set on construction and never modified.
    address public timerAddress;

    /**
     * @notice Constructs the Testable contract. Called by child contracts.
     * @param _timerAddress Contract that stores the current time in a testing environment.
     * Must be set to 0x0 for production environments that use live time.
     */
    constructor(address _timerAddress) {
        timerAddress = _timerAddress;
    }

    /**
     * @notice Reverts if not running in test mode.
     */
    modifier onlyIfTest() {
        //solhint-disable-next-line reason-string
        require(timerAddress != address(0x0));
        _;
    }

    /**
     * @notice Sets the current time.
     * @dev Will revert if not running in test mode.
     * @param time timestamp to set current Testable time to.
     */
    // function setCurrentTime(uint256 time) external onlyIfTest {
    //     Timer(timerAddress).setCurrentTime(time);
    // }

    /**
     * @notice Gets the current time. Will return the last time set in `setCurrentTime` if running in test mode.
     * Otherwise, it will return the block timestamp.
     * @return uint for the current Testable timestamp.
     */
    function getCurrentTime() public view returns (uint256) {
        if (timerAddress != address(0x0)) {
            return Timer(timerAddress).getCurrentTime();
        } else {
            return block.timestamp;
        }
    }
}
"
